import React from 'react'
import { Container } from '../styled/layoutStyle'

function History() {
function isPrime(num) {
  for (let i = 2; i * i <= num; i++)
      if (num % i === 0)
        return false; 
  return num > 1;
}
console.log(isPrime(13));
  return (
    <Container>
        <h1>History</h1>
    </Container>
  )
}

export default History
